import axios from 'axios';
url = 'http://localhost:3000/signup';

export default function Signup({name:name, email, password}) {
  return axios.post(url, {
    name: name,
    email: email,
    password: password
  })
  .then(function (response) {
    console.log(response);
  })
  .catch(function (error) {
    console.log(error);
  });
}
